import React from "react";
import DeleteOutlinedIcon from "@material-ui/icons/DeleteOutlined";

const ToDoLists = (props) => {
  return (
    <>
      <div className='todo_style'>
        <span>
          <DeleteOutlinedIcon />
        </span>
        <i
          className='fa fa-times'
          aria-hidden='true'
          onClick={() => {
            props.onSelect(props.id);
          }}
        />
        <li>{props.text}</li>
      </div>
    </>
  );
};

export default ToDoLists;
